Уже говорил множество раз о том, что я полюбил Волгу и обязательно к ней вернусь.

Всем кто там не был, советую побывать там.

На Волге располагается множество интересных городов, таких как Рыбинск, Мышкин, Ярославль, Кострома, Углич, Тутаев, Нижний Новгород, Чебоксары, Казань, Ульяновск, Самара, Сызрань, Саратов, и конечно же Волгоград.

А сколько ещё городов, деревушек. Их множество!

Очень хочу побывать в Волгограде, в следующем году обязательно туда попаду!

Длина нашей любимой Волги 3530км! Какая она большая.

Да, Волга не самая длинная река в России, на сколько я помню, самая длинная это река Лена.

Но, она от этого не становится хуже)

Путешествуйте, открывайте для себя новое, выходите из своих рамок, как ни как, движение жизнь.

Всем мир ✌️

